window.bookSummaryJSON = "<p><b>The time to confront the evil elf is at hand. Magic runs rampant, and justice will have its day.</b></p> <p>Elves are stepping back into the spotlight, not taking any hell from anyone. Magic flows as new enemies arise in all directions.</p> <p>While once I was trying to survive, now I'm in the midst of it...and loving every second. My team is badass, and I stand with them in skills and expertise. A reckoning is at hand after they took our Djinn, and we will bring the thunder.</p> <p>Join me in my whirlwind journey that involved elves, monsters, and more than one hottie in my bed.</p> <p><i>Warning: Harem elements. The spicy sort, with detail.</i></p>"; 
